import React, { useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState([
    { sector: '' }, // Set initial values
    { title: '', rating: 0 }, // Set the default choice to '1'
    { rating: 1 },
  ]);
  const [recommendations, setRecommendations] = useState('');
  const [hasClickedRecommend, setHasClickedRecommend] = useState(false);

  const handleSubmit = async () => {
    try {
      const response = await fetch('http://localhost:3001/get-recommendations', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        // You can send movie data to your backend if needed
        // body: JSON.stringify({ movies: movies })
        body: JSON.stringify({ movies: movies })
      });

      if (response.ok) {
        const data = await response.json();
        setRecommendations(data.recommendations);
        setHasClickedRecommend(true);
      } else {
        console.error('Failed to retrieve recommendations');
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>Generative AI Stock Advisor</p>
        <form onSubmit={e => e.preventDefault()}>
          {movies.map((movie, index) => (
            <div key={index}>
            {index === 0 ? (
              <div>
                <p>Stock Market Sector</p>
                <select
                    value={movie.sector}
                    onChange={(e) => handleInputChange(index, 'sector', e.target.value)}
                  >
                    <option value="healthcare">Choose One</option>
                    <option value="healthcare">Healthcare</option>
                    <option value="materials">Materials</option>
                    <option value="real estate">Real Estate</option>
                    <option value="consumer staples">Consumer Staples</option>
                    <option value="consumer discretionary">Consumer Discretionary</option>
                    <option value="utilities">Utilities</option>
                    <option value="energy">Energy</option>
                    <option value="industrials">Industrials</option>
                    <option value="consumer services">Consumer Services</option>
                    <option value="financials">Financials</option>
                    <option value="technology">Technology</option>
                  </select>
              </div>
            ) : index === 1 ? (
              <div>
                <p>Holding Length in Years</p>
                <select
                    value={movie.title}
                    onChange={(e) => handleInputChange(index, 'title', e.target.value)}
                  >
                    <option value="1">1</option>
                    <option value="2">2</option>
                    <option value="3">3</option>
                    <option value="4">4</option>
                    <option value="5">5</option>
                    <option value="6">6</option>
                    <option value="7">7</option>
                    <option value="8">8</option>
                    <option value="9">9</option>
                    <option value="10+">10+</option>
                  </select>
              </div>
            ) : (
              <div>
                <p>Max Price</p>
                <input
                  type="range"
                  min={1}
                  max={1000}
                  value={movie.rating}
                  onChange={(e) => handleInputChange(index, 'rating', parseInt(e.target.value))}
                />
                <p>${movie.rating}</p> {/* Display the slider value */}
              </div>
            )}
          </div>
          ))}
          <button onClick={handleSubmit}>Get Recommendations</button>
        </form>

        {hasClickedRecommend && (
          <div>
            <h2>Based on your preferences, here are some more movie recommendations:</h2>
            <p>{recommendations}</p>
          </div>
        )}
      </header>
    </div>
  );

  function handleInputChange(index, field, value) {
    const newMovies = [...movies];
    newMovies[index][field] = value;
    setMovies(newMovies);
  }

  // function handleStarClick(index, starNumber) {
  //   handleInputChange(index, 'rating', starNumber);
  // }
}

export default App;
